import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <ul className="container">
      <li className="list-item">
        <Link to="/" className>My Site</Link>
      </li>
      <li className="list-item">
        <Link to="/addpost">New Post</Link>
      </li>
    </ul>
  );
};

export default Header;
